import React, { useEffect } from 'react'
import './Cart.css'
import { Link } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'
import { fetchCart, removeFromCart, changeProductQuantity, removeAllProducts } from '../../Features/Cart'
import Axios, { ImagePath } from '../../Axios'


import Navbar from '../../Components/Navbar/NavBar'
import produce from 'immer'



function Cart() {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchCart())
    }, [dispatch])
    const { cartInfo } = useSelector(state => state.cart)

    const changeQuantity = (quantity, id) => {
        dispatch(changeProductQuantity({ id, quantity }))
        Axios.put(`cart/change-product-quantity/${id}`, { quantity }).then(res => {
            if (res.data.status) {
            }
        })
    }
    const removeCartProduct = id => {
        dispatch(removeFromCart(id))
        Axios.put('cart/remove-product/' + id, { id: id }).then(res => {
        })
    }
    const deleteAll = id => {
        dispatch(removeAllProducts())
        Axios.delete('cart/remove-all-products').then(res => {
            if (res.data.status) {
            }
        })
    }
    return (
        <div>

            <Navbar></Navbar>
            <div className='cart-container'>
                <div className="cart-left">
                    <div className="cart-left-header">
                        <div className="cart-left-header-left">
                            <h1 className="cart-h1-mycart">My Cart</h1>

                        </div>
                        <div className="cart-left-header-right">

                        </div>
                    </div>
                    <div className="cart-left-body">
                        {
                            cartInfo.map((item, index) => {
                                return (
                                    <div className="cart-left-body-product" key={index}>

                                        <div className="cart-left-body-product-image">
                                            <img src={ImagePath(item.imageId)} alt="loading" />
                                        </div>
                                        <div className="cart-left-body-product-details">
                                            <span className='c-p-name'>{item.name}</span>
                                            <span className='c-p-stock'>inStock</span>
                                            <span className='c-p-price'>₹24 kg</span>


                                        </div>
                                        <div className="cart-left-body-product-quantity">
                                            <button onClick={()=>changeProductQuantity(-.5,item._id)} style={{ backgroundColor: 'red' }} className="cart-product-quantity-button">-</button>
                                            <span className='cart-prdocut-show-quantity'>23.5<span style={{fontSize:'10px'}}>kg</span></span>
                                            <button onClick={() => changeProductQuantity(.5, item._id)} className="cart-product-quantity-button">+</button>
                                        </div>
                                        <div className="cart-left-body-prdouct-total">
                                            <span>₹24</span>
                                        </div>
                                        <div>
                                            <button className="cart-prdocut-remove">remove</button>
                                        </div>
                                    </div>
                                )
                            })
                        }
                    </div>

                </div>
                <div className="cart-right">
                    <div className='cart-bill'>
                        <span>PRICE DETAILS</span>
                    </div>
                    <div className='cart-p-t-billing'>
                        <span>Products Total </span>
                        <span>₹1055</span>
                    </div>
                    <div className='cart-d-p-billing' >
                        <span>delivery price</span>
                        <span style={{color:'lightgreen'}}>Free</span>
                    </div>
                    <div className="cart-order-total">
                        <span>Total Price</span>
                        <span>₹1055</span>
                    </div>
                    <div className='cart-place-order'>
                        <button className='place-order'>Place Order</button>
                    </div>
                </div>
            </div>

        </div>
    )

}

export default Cart
